    data = sys.stdin.read().split()
    n = int(data[0])
    m = int(data[1])

    # Build adjacency list for graph
    graph = [[] for _ in range(n+1)]

    idx = 2
    for i in range(m):
        u = int(data[idx]); v = int(data[idx+1]); idx += 2
        graph[u].append(v)
        graph[v].append(u)

    # Find all cycles in the graph
    visited = [False] * (n+1)
    cycle_nodes = []

    def dfs(node, parent):
        if visited[node]:
            return

        visited[node] = True
        cycle_nodes.append(node)

        for neighbor in graph[node]:
            if neighbor == parent:
                continue

            if visited[neighbor]:
                # Found cycle
                start = cycle_nodes.index(neighbor) + 1
                end = len(cycle_nodes) - 1
                cycle_length = end - start + 1
                print(start, end, cycle_length)
                return

            dfs(neighbor, node)

    for i in range(1, n+1):
        if not visited[i]:
            dfs(i, None)

    # Count pairs with same color
    count_same_color = {}
    for node in range(1, n+1):
        count_same_color[node] = 0

    for node in range(1, n+1):
        for neighbor in graph[node]:
            if neighbor in cycle_nodes:
                count_same_color[node] += 1

    total_pairs = 0
    for k, freq in count_same_color.items():
        total_pairs += freq * (freq - 1) // 2

